DROP TABLE wp_expense;
CREATE TABLE wp_expense (
    expense_Id INT UNIQUE,
    ex_name VARCHAR(64) CHARACTER SET utf8 NOT NULL,
    ex_date DATE,
    ex_exchange_category ENUM('Food','Accommodation','Transport','Leisure','School','Survival','Jie Bo','Pre-Departure','Flights') NOT NULL,
    ex_city_category ENUM('Grocery','Restaurant','To-go','Accommodation','Transport','Activities','Wants', 'AIRPORT') DEFAULT NULL,
    ex_amount NUMERIC(6, 2) NOT NULL DEFAULT '0.00',
    ex_payment_mode ENUM('Cash','Card') NOT NULL,
    ex_city enum('Iceland','London','Barcelona','Madrid','Amsterdam','Brussels','Warsaw','Krakow','Vienna','Budapest','Copenhagen','Milan','Florence','Rome','Athens','Santorini','Istanbul','Edinburgh','Berlin','Prague','Paris') DEFAULT NULL
);
